import React from 'react'
import "./App.css"
import ProductCard from './components/ProductCard'



const App = () => {

  const RandomPrice = () => {
    return (`${Math.round(Math.random() * 1000)}$`)
  }

  return (
    <div>
      <p>Hello, World</p>
      <ProductCard title={'Apple'} price={RandomPrice()} imgUrl={'https://cs13.pikabu.ru/avatars/3017/x3017353-1154967218.png'} />

      <ProductCard title={'Orange'} price={RandomPrice()} imgUrl={'https://johnecker.files.wordpress.com/2010/12/orange-and-slices-photo-by-john-ecker.jpg?w=375&h=200'} />


    </div>
  )
}

export default App
